import { USER_SIGN_UP } from "../constants/GetUserConstants"

const secondState = {
    userList: [],
    userSignup: []
}

export default (state = secondState, action) => {
    switch (action.type) {

        case USER_SIGN_UP:
            state.userSignup = action.userSignup

        default:
            return state
    }
}
